import React from 'react';

const homePage = () => {
  return (
    <>
      <div className="bg-white border-gray-200 px-2 sm:px-4 py-2.5">
        <div className="container flex flex-wrap mx-auto sm:my-24">
          <div className="mt-10 mx-auto sm:mt-12 sm:px-6 md:mt-16 lg:mt-20 lg:px-8 h-full">
            <div className="flex flex-col md:flex-row w-full items-start justify-between md:justify-start h-full md:h-1/2">

            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default homePage;
